pragma solidity ^0.4.24;


contract thirmprotocoladdressmap {

    mapping(address => mapping(string => string)) store;
    uint MAX_LENGTH = 999;

    function getaddress(address _acct, string _key) public view returns(string) {
        return store[_acct][_key];
    }
    function setaddress(string _key, string _value) public {
        require(bytes(_value).length <= MAX_LENGTH);
        store[msg.sender][_key] = _value;
    }
}
